pragma solidity ^0.5.8;

import "./ERC20.sol";
import "./Pausable.sol";
import "./Initializable.sol";
import "./Context.sol";
import "./Address.sol";

/**
 * @dev Implementation of the Social Token.
 *
 * This ...
 */
contract Social is ERC20, Pausable {
    using SafeMath for uint256;

    uint public tokenPrice;
    uint public voluntaryGasAdvance;

    // EAN is 13 digits long
    // uint max is 4294967295 (9 digits)
    // string array is not supported solidity-wise
    mapping (address=>mapping(uint=>bool)) private vendorItemBlacklistMap;
    mapping (address=>bool) private vendorMap;
    mapping (address=>bool) private approvedVendorMap;

    modifier onlyVendor(address vendor) {
        require(vendorMap[vendor]==true, "Caller is not a vendor");
        _;
    }

    modifier onlyApprovedVendor(address vendor) {
        require(approvedVendorMap[vendor]==true, "Caller is not an approved vendor");
        _;
    }

    function initialize() public initializer {
        Pausable.initializePausable(_msgSender());
        vendorMap[0x96c65A2b5Ef50bc13f227A1f3c285e5045a4664B] = true;
        vendorMap[0x9Ea5cB0a3162a50BF5cdd694451A21B557b1967D] = true;
        vendorMap[0x30DFf58C12349297fea380A95B59211367dE8e72] = true;

        // ID 10: Weltenburger Urtyp Hell Beer
        vendorItemBlacklistMap[0x96c65A2b5Ef50bc13f227A1f3c285e5045a4664B][10] = true;
        // ID 11: Marlboro Red Cigarettes
        vendorItemBlacklistMap[0x96c65A2b5Ef50bc13f227A1f3c285e5045a4664B][11] = true;
        // ID 12: Ferrero Mon Chri Chocolates
        vendorItemBlacklistMap[0x96c65A2b5Ef50bc13f227A1f3c285e5045a4664B][12] = true;
        tokenPrice = 6 szabo;

        /**
         * Avg. spent token per purchase = 4000, avg. bought unique items per purchase = 5
         * 4000 Tokens/Purchase --> 172 Gwei/Token
         * 69053 Gas/SpentTransaction
         */
        voluntaryGasAdvance = 220000000000 wei; // == 220 Gwei
    }

    function buyToken(uint amount) external payable whenNotPaused {
        require(msg.value >= amount.mul(tokenPrice.add(voluntaryGasAdvance)), "Not enough funds sent");
        // TODO Overflow check
        _mint(_msgSender(), amount);
    }

    function donateToken(uint amount, string calldata receiverAddress) external whenNotPaused notHomeless(_msgSender()) {
        address parsedAddress = parseAddr(receiverAddress);
        require(_msgSender() != parsedAddress, "You cannot donate SocialTokens to yourself");
        ERC20.setHomelessMap(parsedAddress);
        _transfer(_msgSender(), parsedAddress, amount);
        address payable payableReceiver = address(uint160(parsedAddress));
        Address.sendValue(payableReceiver, voluntaryGasAdvance.mul(amount));
    }
    // TODO must be onlyHomeless in the future, for testing purpose only right now
    function spendToken(uint amount, string calldata vendorAddress, uint[] calldata basketItems) external onlyVendor(parseAddr(vendorAddress)) whenNotPaused {
        address parsedAddress = parseAddr(vendorAddress);
        for (uint i = 0; i < basketItems.length; i++) {
            // TODO
            require (!vendorItemBlacklistMap[parsedAddress][basketItems[i]], "No alc, no cigarettes!");
        }
        _transfer(_msgSender(), parsedAddress, amount);
    }

    function withdraw(uint amount) external onlyVendor(_msgSender()) whenNotPaused {
        require(address(this).balance >= tokenPrice.mul(amount), "Not enough funds available");
        _burn(_msgSender(), amount);
        address payable payableVendor = address(uint160(_msgSender()));
        Address.sendValue(payableVendor, tokenPrice.mul(amount));
    }

    function approveVendor(address vendorAddress) public onlyOwner whenNotPaused {
        approvedVendorMap[vendorAddress] = true;
    }

    // not tested yet
    function registerVendor(uint[] memory blacklist) public onlyApprovedVendor(_msgSender()) whenNotPaused {
        vendorMap[_msgSender()] = true;
        approvedVendorMap[_msgSender()] = false;
        for (uint i = 0; i < blacklist.length; i++) {
            vendorItemBlacklistMap[_msgSender()][blacklist[i]] = true;
        }
    }

    // not tested yet
    function deleteVendor(address vendorAddress) public onlyOwner whenNotPaused {
        vendorMap[vendorAddress] = false;
        approvedVendorMap[vendorAddress] = false;
    }

    // not tested yet
    function addToBlacklist(uint[] calldata newItems) external onlyVendor(_msgSender()) whenNotPaused {
        for (uint i = 0; i < newItems.length; i++) {
            vendorItemBlacklistMap[_msgSender()][newItems[i]] = true;
        }
    }

    // not tested yet
    function deleteFromBlacklist(uint[] calldata oldItems) external onlyVendor(_msgSender()) whenNotPaused {
        for (uint i = 0; i < oldItems.length; i++) {
            vendorItemBlacklistMap[_msgSender()][oldItems[i]] = false;
        }
    }

    function getBlacklistItem(string calldata vendorAddress, uint itemID) external view whenNotPaused returns(bool) {
        address parsedAddress = parseAddr(vendorAddress);
        return vendorItemBlacklistMap[parsedAddress][itemID];
    }

    /**
     * @dev parse string to adress
     * @param _a string that will be parsed
     */
    function parseAddr(string memory _a) internal pure returns (address _parsedAddress) {
        bytes memory tmp = bytes(_a);
        uint160 iaddr = 0;
        uint160 b1;
        uint160 b2;
        for (uint i = 2; i < 2 + 2 * 20; i += 2) {
            iaddr *= 256;
            b1 = uint160(uint8(tmp[i]));
            b2 = uint160(uint8(tmp[i + 1]));
            if ((b1 >= 97) && (b1 <= 102)) {
                b1 -= 87;
            } else if ((b1 >= 65) && (b1 <= 70)) {
                b1 -= 55;
            } else if ((b1 >= 48) && (b1 <= 57)) {
             b1 -= 48;
           }
            if ((b2 >= 97) && (b2 <= 102)) {
                b2 -= 87;
            } else if ((b2 >= 65) && (b2 <= 70)) {
                b2 -= 55;
            } else if ((b2 >= 48) && (b2 <= 57)) {
             b2 -= 48;
            }
            iaddr += (b1 * 16 + b2);
        }
        return address(iaddr);
    }

    function () external {

    }
}
